package main

import (
	"bytes"
	"encoding/base64"
	"testing"
)

const srcImgBase64 = ""
const resImgBase64 = ""

func TestResize(t *testing.T) {
	data, err := base64.StdEncoding.DecodeString(srcImgBase64)
	if err != nil {
		t.Fatal(err)
	}

	srcBuf := bytes.NewBuffer(data)
	dstBuf := bytes.NewBuffer(nil)
	err = Resize(srcBuf, 50, 50, dstBuf)
	if err != nil {
		t.Fatal(err)
	}

	res := base64.StdEncoding.EncodeToString(dstBuf.Bytes())
	if res != resImgBase64 {
		t.Fatalf("Expected image: %v, got: %v", resImgBase64, res)
	}
}
